function Footer(){
    return(
            <div>
                <div className="footer_page">
                    <p>this is the footer</p>
                </div>
                <style jsx>
                    {`
                        .footer_page{
                            background-color: #47563;
                            padding: 100px 0px;
                        }
                        
                        .footer_page p{
                            font-size: 30px;
                            color: #fff;
                            text-align: center;
                            text-transform: capitalize
                        }
                    `}
                </style>
            </div>

    )
}

export default Footer
